import React from "react";
import "./App.css";
import AboutUs from "./websitedesign/AboutUs";
import ContactUs from "./websitedesign/ContactUs";
import Services from "./websitedesign/Services";
import Specials from "./websitedesign/Specials";
import Home from "./websitedesign/Home";
import Link from "react-router";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route
          path="/index"
          exact
          activeStyle={{ color: "#e8491d" }}
          component={Home}
        />
        <Route
          path="/aboutus"
          activeStyle={{ color: "#e8491d" }}
          component={AboutUs}
        />
        <Route
          path="/contactus"
          activeStyle={{ color: "#e8491d" }}
          component={ContactUs}
        />
        <Route
          path="/services"
          activeStyle={{ color: "#e8491d" }}
          component={Services}
        />
        <Route
          path="/specials"
          activeStyle={{ color: "#e8491d" }}
          component={Specials}
        />
      </Switch>
    </Router>
  );
}

export default App;
